import React, { Component } from 'react';
import './css/Form.css';

class Form extends Component {
  state = {
    nome: '',
    sobrenome: '',
    email: '',
    cpf: '',
    endereco: '',
    cidade: '',
    estado: '',
    residencia: '',
    cargo: '',
    descricao: '',
  };

  render() {
    return (
      <div className="Form">
        <form className="Form-body">
          <label>
          <input type={'text'} name='nome'></input>
          </label>
          <input type={'text'} name='nome'></input>
          <input type={'text'} name='sobrenome'></input>
          <input type={'email'} name='email'></input>
          <input type={'text'} name='cpf'></input>
          <input type={'email'} name='estado'></input>
          <input type={'email'} name='cidade'></input>
          <input type={'email'} name='endereco'></input>
          <input type={'email'} name='residencia'></input>
          <input type={'email'} name='cargo'></input>
          <input type={'email'} name='descricao'></input>
        </form>
      </div>
    );
  }
}

export default Form;
